// @mui material components
import Grid from "@mui/material/Grid";

// Soft UI Dashboard PRO React components
import SuiBox from "components/SuiBox";
import SuiTypography from "components/SuiTypography";
import SuiButton from "components/SuiButton";
import Card from "@mui/material/Card";
// Soft UI Dashboard PRO React example components
import DashboardLayout from "examples/LayoutContainers/DashboardLayout";
import DashboardNavbar from "examples/Navbars/DashboardNavbar";
import Footer from "examples/Footer";
import { useState } from "react";
import Menu from "@mui/material/Menu";
import MenuItem from "@mui/material/MenuItem";
import Divider from "@mui/material/Divider";
import DataTable from "examples/Tables/DataTable";
import datatable4 from "layouts/authentication/error/datatable4";

function EditProduct() {

  const [menu, setMenu] = useState(null);

  // const openMenu = (event) => setMenu(event.currentTarget);
  const closeMenu = () => setMenu(null);

  const renderMenu = (
    <Menu
      anchorEl={menu}
      anchorOrigin={{ vertical: "bottom", horizontal: "left" }}
      transformOrigin={{ vertical: "top", horizontal: "left" }}
      open={Boolean(menu)}
      onClose={closeMenu}
      keepMounted
    >
      <MenuItem onClick={closeMenu}>Status: Paid</MenuItem>
      <MenuItem onClick={closeMenu}>Status: Refunded</MenuItem>
      <MenuItem onClick={closeMenu}>Status: Canceled</MenuItem>
      <Divider sx={{ margin: "0.5rem 0" }} />
      <MenuItem onClick={closeMenu}>
        <SuiTypography variant="button" textColor="error" fontWeight="regular">
          Remove Filter
        </SuiTypography>
      </MenuItem>
    </Menu>
  );

  return (
    <DashboardLayout>
      <DashboardNavbar />

      <SuiBox p={2}>
        <Card id="profile">
          <SuiBox p={3}>
            <Grid container spacing={3} alignItems="center">
              <Grid item>
                <SuiBox height="100%" mt={0.5} lineHeight={1}>
                  <SuiTypography variant="h5" fontWeight="medium">
                    Email Login Details to Clients
                  </SuiTypography>
                </SuiBox>
              </Grid>

              <Grid item xs={12} lg={6}>
                <SuiBox display="flex" justifyContent="flex-end">
                  <SuiButton variant="gradient" buttonColor="info">
                    Apply
                  </SuiButton>
                </SuiBox>
              </Grid>
            </Grid>
          </SuiBox>
        </Card>
      </SuiBox>

      <SuiBox my={3}>
        <SuiBox mb={3}>
          <Grid container spacing={1} alignItems="center">
            <Grid item xs={12} lg={6}>
              <SuiBox p={3}>
                <SuiTypography variant="h5">Email Login Details to Clients</SuiTypography>
              </SuiBox>

            </Grid>

            <Grid item xs={12} lg={6}>
              <SuiBox display="flex" justifyContent="flex-end">
                <SuiButton variant="gradient" buttonColor="info">
                  Apply
                </SuiButton>
              </SuiBox>
            </Grid>
          </Grid>
        </SuiBox>

        <SuiBox display="flex" justifyContent="space-between" alignItems="flex-start" mb={2} >
          {/* <SuiButton variant="gradient" buttonColor="info">
                            new order
                        </SuiButton> */}
          <SuiBox display="flex">
            {/* <SuiButton
                                variant={menu ? "contained" : "outlined"}
                                buttonColor="dark"
                                onClick={openMenu}
                            >
                                filters&nbsp;
                                <Icon className="">keyboard_arrow_down</Icon>
                            </SuiButton> */}
            {renderMenu}
            <SuiBox ml={1}>
              {/* <SuiButton variant="outlined" buttonColor="dark">
                                    <Icon className="">description</Icon>
                                    &nbsp;export csv
                                </SuiButton> */}
            </SuiBox>
          </SuiBox>
        </SuiBox>
        <Card style={{ fontWeight: "bold" }}>
          <DataTable table={datatable4} entriesPerPage={false} />
        </Card>
      </SuiBox>
      <Footer />
    </DashboardLayout>
  );
}

export default EditProduct;
